import Navbar from './components/Navbar'
import Home from "./components/Home"
import About from "./components/About"
import Downlaods from './components/Downloads';
import Welcome from './components/welcome';
import 'bootstrap/dist/css/bootstrap.min.css';
import "bootstrap-icons/font/bootstrap-icons.css";
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import home_img from "./statics/imgs/home_img.jpg"
import home1 from "./statics/imgs/home.jpg"
import table from "./statics/imgs/table.jpg"
import plot_img from "./statics/imgs/plot.jpg"

import SimpleImageSlider from "react-simple-image-slider";

const images = [
  { url: home_img },
  { url: home1 },
  { url: table },
  { url: plot_img }
];

function App() {
  return (
    <Router>
      <div className="App">
      <div>
      <SimpleImageSlider
        width={896}
        height={504}
        images={images}
        showBullets={true}
        showNavs={true}
      />
    </div>
        <Navbar/>
        <Switch>
        <Route exact path="/">
            <Welcome/>
          </Route>
          <Route exact path="/home">
            <Home/>
          </Route>
          <Route exact path="/about">
            <About/>
          </Route>
          <Route exact path="/downloads">
            <Downlaods/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
